import React, {useState} from 'react';
import './index.css'
import Button from '@mui/material/Button';
import AddIcon from '@mui/icons-material/Add';



const CreateNote = () => {
    const [note , setNote] = useState( {
       title :' ',
       content : ' ',
    });

    const InputEvent = (event) => {
      
      //jitne bhi note ka previously data hoga vo store hoga 
      setNote((prevData) =>{
        return {
          ...prevData,

        }
      })
    }

  return (
    <>
      <div className=' main_note'>
      <form>
        <input type = "text" value={note.title} onChange={InputEvent} placeholder='Title' autoComplete = 'off' />
        <textarea rows=' ' column = ' ' value={ note.content} onChange={InputEvent} placeholder='Write a note...'> </textarea>
        <Button>
            <AddIcon  className =" plus_sign" />
        </Button>
       
      </form>

      </div>
    </>
  )
}
export default CreateNote;
